import React ,{Component,useState} from "react";
import Head from "next/head";
import Button from '@material-ui/core/Button';
import { fade, makeStyles, Theme, createStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import InputBase from '@material-ui/core/InputBase';
import Badge from '@material-ui/core/Badge';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import { withStyles } from '@material-ui/core/styles';
import MenuIcon from '@material-ui/icons/Menu';
import SearchIcon from '@material-ui/icons/Search';
import AccountCircle from '@material-ui/icons/AccountCircle';
import MailIcon from '@material-ui/icons/Mail';
import NotificationsIcon from '@material-ui/icons/Notifications';
import MoreIcon from '@material-ui/icons/MoreVert';
import {inHomeComponentProps} from './inHomeComponentProps'
import {inHomeComponentState} from './inHomeComponentState'
  import {homeStyle} from './homeStyle'

class homeComponent extends Component<inHomeComponentProps, inHomeComponentState>  {
    constructor(props:inHomeComponentProps) {
        super(props)
        this.state = {
            menuId:'primary-search-account-menu',
            mobileMenuId : 'primary-search-account-menu-mobile',
            isMenuOpen:false,

           }


    }


    handleDrawerToggle = () => {
        this.setState({ isMenuOpen: !this.state.isMenuOpen })
    }

    render() {
        const {classes, theme} = this.props

        const renderMenu = (
            <Menu
                anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
                id={this.state.menuId}
                keepMounted
                transformOrigin={{ vertical: 'top', horizontal: 'right' }}
                open={this.state.isMenuOpen}
                onClose={this.handleDrawerToggle}
           >
                <MenuItem  >Profile</MenuItem>
            </Menu>
        );
        return (
           <div>




                <AppBar position="static">
                    <Toolbar>
                        <IconButton
                            edge="start"
                            className=''
                            color="inherit"
                            aria-label="open drawer"
                        >
                            <MenuIcon />
                        </IconButton>
                        <Typography   variant="h6" noWrap>
                            <svg className="MuiSvgIcon-root jss191"   focusable="false" viewBox="10 0 30 65"
                                 aria-hidden="true" role="presentation">
                                <g data-v-423bf9ae="" id="4c534ed8-4e27-4483-ac22-b4c7c7960151"
                                   transform="matrix(0.6313940193586971,0,0,0.6313940193586971,-6.023900765138428,-1.5784850483967432)"
                                   stroke="none" fill="white">
                                    <path
                                        d="M54.2 2.5c-5.5 0-10.8 1.2-15.5 3.5-12.4 5.8-21 18.3-21 32.8v6L10.3 59c-1.9 3.6-.1 6.5 3.9 6.5h3.5V78.9c0 4.2 3.4 7.6 7.6 7.6l10.5-1.6v10.6c0 1.3 1.2 2.2 2.6 2l37.7-6.7c1.4-.3 2.6-1.6 2.6-3.1V65.5c7.2-6.6 11.8-16.1 11.8-26.7-.1-20-16.3-36.3-36.3-36.3zm0 62.7c-14.7 0-26.6-12-26.6-26.6 0-14.7 12-26.6 26.6-26.6 14.7 0 26.6 12 26.6 26.6 0 14.7-11.9 26.6-26.6 26.6zm10.5-31.7l-.1-3.5c0-5.6-4.6-10.2-10.2-10.2S44.2 24.4 44.2 30v3.5H44c-1.5 0-2.7 1.2-2.7 2.7V51c0 1.5 1.2 2.7 2.7 2.7h20.7c1.5 0 2.7-1.2 2.7-2.7V36.2c0-1.5-1.2-2.7-2.7-2.7zm-8.8 10.8c-.2.1-.3.3-.3.5v3.3c0 .5-.2.9-.6 1.1-1 .5-1.9-.2-1.9-1.1v-3.3c0-.2 0-.4-.2-.5-1-.7-1.3-2-.8-3.1s1.6-1.7 2.8-1.5c1.2.2 2.1 1.2 2.1 2.5 0 .9-.4 1.6-1.1 2.1zm4.2-10.8H48.7V30c0-3.2 2.6-5.7 5.7-5.7s5.7 2.6 5.7 5.7v3.5z"></path>
                                </g>
                            </svg>
                        </Typography>
                        <div className={classes.search}>
                            <div className={classes.searchIcon}>
                                <SearchIcon />
                            </div>
                            <InputBase
                                placeholder="Searchâ€¦"
                                classes={{
                                    root: classes.inputRoot,
                                    input: classes.inputInput,
                                }}
                                inputProps={{ 'aria-label': 'search' }}
                            />
                        </div>
                        <div className={classes.grow} />
                        <div className={classes.sectionDesktop}>

                            <IconButton aria-label="show 17 new notifications" color="inherit">
                                <Badge badgeContent={17} color="secondary">
                                    <NotificationsIcon />
                                </Badge>
                            </IconButton>
                            <IconButton
                                edge="end"
                                aria-label="account of current user"
                                aria-controls={this.state.menuId}
                                aria-haspopup="true"

                                color="inherit"
                            >
                                <AccountCircle />
                            </IconButton>
                        </div>
                        <div className={classes.sectionMobile}>
                            <IconButton
                                aria-label="show more"

                                aria-haspopup="true"

                                color="inherit"
                            >
                                <MoreIcon />
                            </IconButton>
                        </div>
                    </Toolbar>
                </AppBar>

               {renderMenu}

            </div>

        )

    }

}

export default withStyles(homeStyle as any)(homeComponent)
